description:
It&amp;#039;s not often a wheat field grabs the headlines but in Britain this year 
everyone&amp;#039;s talking about an epidemic of crop circles.  They range from three to 
thirty meters in diameter.  Although circles appear in other countries 
including western Canada there are more in the south of England than anywhere 
else in the world.


